package com.rk.leetcode;

import java.util.*;

public class Anagram {

    private static final String s="";
    private static final String t="";

    public static void main(String[] args) {

        Anagram anagram = new Anagram();
        boolean res = anagram.isAnagram(s, t);
        System.out.println(res);
    }


    public boolean isAnagram(String s, String t) {
        if(s.length() != t.length()){
            return false;
        }
        Map<Character,Long> sf = new HashMap<>();
        Map<Character,Long> tf = new HashMap<>();
        for(Character ch : s.toCharArray()){
            if(sf.containsKey(ch)){
                sf.put(ch,sf.get(ch)+1);
            }else{
                sf.put(ch,1L);
            }
        }
        for(Character ch: t.toCharArray()){
            if(tf.containsKey(ch)){
                tf.put(ch,tf.get(ch)+1);
            }else{
                tf.put(ch,1L);
            }
        }
        for(Map.Entry<Character,Long> entry: sf.entrySet()) {
            Character key = entry.getKey();
            Long value = entry.getValue();
            if ((!tf.containsKey(key)) || (!Objects.equals(tf.get(key), value))) {
                return false;
            }
        }
        return true;
    }
}
